[BITS 16]
[ORG 0x7C00]

mov bp, 0xffff 	;set base pointer
mov sp, bp		;set stack pointer to bp

mov si, MSG_KERBY
call print_string

mov cx, 50
call set_delay

mov al,0x40
mov bx, img_location ;0x7e00
call read_from_disk

mov ax, 0x13	;Set video mode
int 0x10

push 0x0a000 ;push video memory address onto the stack

pop es ;set far pointer 
xor si, si ;clear
xor ax, ax ;color

mov si, IMG_DATA
call render_frame

jmp $
;For bonus points, make a jump to the address at which the original bootloader is stored.
;(You DID save the original 0x8940 bytes somewhere, right?)

;Functions

read_from_disk:
	pusha
	
	mov ah, 0x02	;ah = read sectors from drive
	
	mov ch,	0x00	;ch = track
	mov dh, 0x00	;dh = head
	mov cl, 0x02	;cl = sector

	push bx
	mov bx, 0x00	;es:bx = buffer address pointer
	mov es, bx
	pop bx
	int 0x13		;BIOS interrupt
	
	jc read_error	;throw read error if CF is set
					;CF = Ret on error, clear if no error
					;AH = return code
					;al = actual sectors read count
	popa
	ret
	
read_error:
	mov si, DISK_ERROR	
	call print_string
	jmp $
	
print_string:
	_loop:
		lodsb
		cmp al,0
		je _end
		mov ah, 0x0e 	;BIOS scrolling teletype
		int 0x10		;video interrupt
		jmp _loop
	_end:
	ret	
	
set_delay:
	mov ah,0x86 
	int 15h
	ret

render_frame:
	mov bx, 0x31c0
	_start:
		lodsb
		mov [es:bx], ax
		inc bx
		cmp bx, 0xb900
		jne _start
	;jmp _start
	
	_end_draw:
	ret
	
DISK_ERROR	db 'Error reading disk',0	
MSG_KERBY 	db 'Pour one out for teh script kitteh.',0

